// Step1.js
import React from "react";

const Step1 = ({ formData, errors, handleChange }) => {
  return (
    <div className="step">
      <h2>Step 1</h2>
      <div className="form-group">
        <label>Toilet Name</label>
        <input
          type="text"
          name="toiletName"
          value={formData.toiletName}
          onChange={handleChange}
          className={errors.toiletName ? "border" : ""}
        />
        {/* {errors.toiletName && (
          <span className="error">{errors.toiletName}</span>
        )} */}
      </div>
    </div>
  );
};

export default Step1;
